import React from "react";
import Header from "../Components/Header";

function SkillPage(props) {
    return  (
        <div className = "skill-bg">
            <Header 
            mainHeader = {props.mainHeader} 
            style = {{"color": "silver"}}
            />

        </div>
    )
}

export default SkillPage
